$ErrorActionPreference = "Stop"

# ============================================================
# CONFIG
# ============================================================

$BaseDir            = "C:\ProgramData\Acceleron\Wallpaper"

$PolicyScriptPath   = "$BaseDir\WallpaperPolicy.exe"
$UpdateExePath      = "$BaseDir\WallpaperUpdate.exe"
$CerPath            = "$BaseDir\GainwellWallpaper.cer"

$PolicyTaskName     = "Wallpaper Policy"
$UpdateTaskName     = "Wallpaper Update Schedule"
$RenewTaskName      = "Wallpaper Certificate AutoRenew"

$CertSubject        = "CN=Gainwell Wallpaper Automation"

$RenewBeforeDays    = 30
$TriggerInterval    = 5
$Now                = Get-Date
$IsSystem           = ([Security.Principal.WindowsIdentity]::GetCurrent().IsSystem)

# ============================================================
# ENSURE BASE DIRECTORY
# ============================================================

if (-not (Test-Path $BaseDir)) {
    New-Item -Path $BaseDir -ItemType Directory -Force | Out-Null
}

# ============================================================
# CERTIFICATE: CREATE + TRUST (ONCE)
# ============================================================

if ($IsSystem) {
$Cert = Get-ChildItem Cert:\LocalMachine\My |
        Where-Object {
            $_.Subject -like "*$($CertSubject.Replace('CN=',''))*" -and
            $_.NotAfter -gt $Now
        } |
        Sort-Object NotAfter -Descending |
        Select-Object -First 1
		
$NeedsRenewal = $true

if ($Cert) {
    $DaysLeft = ($Cert.NotAfter - $Now).Days
    if ($DaysLeft -gt $RenewBeforeDays) {
        $NeedsRenewal = $false
    }
}

if ($NeedsRenewal) {

    $Cert = New-SelfSignedCertificate `
        -Type CodeSigningCert `
        -Subject $CertSubject `
        -CertStoreLocation "Cert:\LocalMachine\My" `
        -KeyAlgorithm RSA `
        -KeyLength 2048 `
        -NotAfter $Now.AddYears(5)

    if (-not $Cert) {
        throw "Certificate creation failed. Run script as Administrator or SYSTEM."
    }

    Export-Certificate -Cert $Cert -FilePath $CerPath -Force | Out-Null

    Import-Certificate -FilePath $CerPath `
        -CertStoreLocation "Cert:\LocalMachine\Root" | Out-Null

    Import-Certificate -FilePath $CerPath `
        -CertStoreLocation "Cert:\LocalMachine\TrustedPublisher" | Out-Null
    }
}

Set-ExecutionPolicy -Scope LocalMachine -ExecutionPolicy RemoteSigned -Force

# ============================================================
# CLEAN OLD TASKS (SAFE)
# ============================================================

Get-ScheduledTask $PolicyTaskName -ErrorAction SilentlyContinue | Unregister-ScheduledTask -Confirm:$false
Get-ScheduledTask $UpdateTaskName -ErrorAction SilentlyContinue | Unregister-ScheduledTask -Confirm:$false
Get-ScheduledTask $RenewTaskName  -ErrorAction SilentlyContinue | Unregister-ScheduledTask -Confirm:$false

Remove-Item "C:\Windows\System32\WallpaperPolicy.vbs" -Force -ErrorAction SilentlyContinue
Remove-Item "C:\Windows\System32\SetWallpaper.vbs" -Force -ErrorAction SilentlyContinue

# ============================================================
# EMBEDDED BINARIES (BASE64)
# ============================================================

$WallpaperPolicyExeBase64 = @'

'@

$WallpaperUpdateExeBase64 = @'

'@

# Decode Base64
$PolicyExeBytes = [Convert]::FromBase64String($WallpaperPolicyExeBase64)
$UpdateExeBytes = [Convert]::FromBase64String($WallpaperUpdateExeBase64)

# ============================================================
# WRITE POLICY SCRIPT (SYSTEM)
# ============================================================
$WritePolicyExe = $true

if (Test-Path $PolicyScriptPath) {
    $Sig = Get-AuthenticodeSignature $PolicyScriptPath
    if ($Sig.Status -eq 'Valid') {
        $WritePolicyExe = $false
    }
}

if ($WritePolicyExe) {
    [IO.File]::WriteAllBytes($PolicyScriptPath, $PolicyExeBytes)

    $Sig = Get-AuthenticodeSignature $PolicyScriptPath
    if ($Sig.Status -ne 'Valid') {
        throw "WallpaperPolicy.exe signature validation failed after write"
    }
}

# ============================================================
# WRITE UPDATE SCRIPT (USER / SYSTEM DUAL MODE)
# ============================================================

$WriteUpdateExe = $true

if (Test-Path $UpdateExePath) {
    $Sig = Get-AuthenticodeSignature $UpdateExePath
    if ($Sig.Status -eq 'Valid') {
        $WriteUpdateExe = $false
    }
}

if ($WriteUpdateExe) {
    [IO.File]::WriteAllBytes($UpdateExePath, $UpdateExeBytes)

    $Sig = Get-AuthenticodeSignature $UpdateExePath
    if ($Sig.Status -ne 'Valid') {
        throw "WallpaperUpdate.exe signature validation failed after write"
    }
}

# ============================================================
# SCHEDULED TASK: POLICY (SYSTEM)
# ============================================================

# Define the action to execute the VBScript script
$actionPolicy = New-ScheduledTaskAction -Execute $PolicyScriptPath

# Create the time-based trigger
$timeTriggerPolicy = New-ScheduledTaskTrigger -Once -At (Get-Date).AddMinutes(5)

# Create the logon-based trigger
$logonTriggerPolicy = New-ScheduledTaskTrigger -AtLogOn

# Define the task settings
$taskSettingsPolicy = New-ScheduledTaskSettingsSet -AllowStartIfOnBatteries -DontStopIfGoingOnBatteries -WakeToRun -StartWhenAvailable
$taskSettingsPolicy.Hidden = $true
$taskSettingsPolicy.DisallowStartIfOnBatteries = $false
$taskSettingsPolicy.Priority = 7
$taskSettingsPolicy.ExecutionTimeLimit = "PT0S"

# Store all triggers in an array
$triggersPolicy = @($timeTriggerPolicy, $logonTriggerPolicy)

# Define the task principal
$taskPrincipalPolicy = New-ScheduledTaskPrincipal -GroupId "NT AUTHORITY\INTERACTIVE" -RunLevel Highest

# Register the scheduled task
$null = Register-ScheduledTask -Action $actionPolicy -Trigger $triggersPolicy -TaskName $PolicyTaskName -Settings $taskSettingsPolicy -Principal $taskPrincipalPolicy -Force

# ============================================================
# SCHEDULED TASK: WALLPAPER UPDATE (USER, NO POPUP)
# ============================================================

# Define the action to execute the VBScript script
$action = New-ScheduledTaskAction -Execute $UpdateExePath

# Create the time-based trigger
$timeTrigger = New-ScheduledTaskTrigger -Once -At (Get-Date).AddMinutes(10) -RepetitionInterval (New-TimeSpan -Minutes $TriggerInterval)

# Create the logon-based trigger
$logonTrigger = New-ScheduledTaskTrigger -AtLogOn
# Assign the repetition settings from the one-time trigger to the logon trigger
$logonTrigger.Repetition = $timeTrigger.Repetition

# Create the session state change trigger
$StateChangeTrigger = Get-CimClass -Namespace Root/Microsoft/Windows/TaskScheduler -ClassName MSFT_TaskSessionStateChangeTrigger
$onUnlockTrigger = New-CimInstance -CimClass $StateChangeTrigger -Property @{StateChange = 8} -ClientOnly
$onUnlockTrigger.Repetition = New-CimInstance -CimClass (Get-CimClass -Namespace Root/Microsoft/Windows/TaskScheduler -ClassName MSFT_TaskRepetitionPattern) -Property @{Interval = 'PT5M'} -ClientOnly
	
# Store all triggers in an array
$triggers = @($timeTrigger, $logonTrigger, $onUnlockTrigger)

# Define the task settings
$taskSettings = New-ScheduledTaskSettingsSet -AllowStartIfOnBatteries -DontStopIfGoingOnBatteries -WakeToRun -StartWhenAvailable
$taskSettings.Hidden = $true
$taskSettings.DisallowStartIfOnBatteries = $false
$taskSettings.Priority = 7
$taskSettings.ExecutionTimeLimit = "PT0S"

# Define the task principal
$taskPrincipal = New-ScheduledTaskPrincipal -GroupId "NT AUTHORITY\INTERACTIVE" -RunLevel Highest

# Register the scheduled task
$null = Register-ScheduledTask -Action $action -Trigger $triggers -TaskName $UpdateTaskName -Settings $taskSettings -Principal $taskPrincipal -Force

Write-Host "Wallpaper Policy Updated"